oxy_webhelp_navlinks = {"rolling_upgrade_rbk_cdm_software-d22908e3765":{"topics":[{"title":"Advantages of using a rolling upgrade","shortdesc":"<p class=\"shortdesc\">With a rolling upgrade, you can upgrade a Rubrik cluster or third-party hardware         without downtime. Rolling upgrades provide a set of advantages, such as simplified upgrade         workflow, support for third-party hardware upgrades, and varied levels of job         resumability.<\/p>","href":"saas\/rolling_upgrade_advantages.html","attributes":{"data-id":"rolling_upgrade_advantages"},"menu":{"hasChildren":false},"tocID":"rolling_upgrade_advantages-d22908e3776","topics":[]},{"title":"Supported workloads for rolling upgrade","shortdesc":"<p class=\"shortdesc\">Information about the supported workloads during a rolling upgrade.<\/p>","href":"saas\/supported_workloads_rolling_upgrade.html","attributes":{"data-id":"supported_workloads_rolling_upgrade"},"menu":{"hasChildren":false},"tocID":"supported_workloads_rolling_upgrade-d22908e3787","topics":[]},{"title":"Rolling upgrade statuses for workloads","shortdesc":"<p class=\"shortdesc\">Information about the statuses for workloads, such as resumable, restartable, and         unsupported, during a rolling upgrade.<\/p>","href":"saas\/rolling_upgrade_statuses.html","attributes":{"data-id":"rolling_upgrade_statuses"},"menu":{"hasChildren":false},"tocID":"rolling_upgrade_statuses-d22908e3798","topics":[]}]}};